(42059, 10442, 10233, NULL, 'Selama ikut pelatihan di UPT PTKK Surabaya jurusan Desain Grafis, rasanya campur aduk. Di awal sempat ngerasa bingung banget, apalagi pas belajar tools dan materi yang agak rumit. Tapi makin ke sini, aku jadi makin ngerti dan malah tertarik banget buat ngulik lebih dalam. Suasananya juga enak, temen-temen saling bantu, pengajarnya juga asik dan sabar banget ngajarin dari nol. Walaupun kadang capek dan pusing, tapi dari sini aku ngerasa diri aku berkembang, bukan cuma dalam hal desain tapi juga dari cara mikir dan kerja. Buat temen-temen yang mau ikut, siapin mental dan semangat, karena walaupun nggak gampang, tapi seru dan bener-bener nambah ilmu.', NOW(), NOW()),
